ControlPropertyState.AutoRuleBindingString:
ClearCollect(
    colDadosParaPatch,
    AddColumns(
        Filter(
            db_acomp_perguntas_pesquisas,
            id_tipo_pesquisa = ComboBox1_2.Selected.id_tipo_pesquisa
        ),
        id_contrato, ComboBox1.Selected.n_contrato,    
        id_empreendimento, ComboBox1_1.Selected.id_contrato_empreendimento,
        data_fiscalizacao, DatePicker1.SelectedDate,
        id_fiscalizacao, Concatenate(ComboBox1_1.Selected.id_contrato_empreendimento, "-", ComboBox1_2.Selected.id_tipo_pesquisa, "-", DatePicker1.SelectedDate)
    )
);

Patch(
    db_acomp_empreendimento_fiscalizacao,
    Defaults(db_acomp_empreendimento_fiscalizacao), 
    {
        id_contrato: ComboBox1.Selected.n_contrato, 
        id_empreendimento: ComboBox1_1.Selected.id_contrato_empreendimento,
        data_fiscalizacao: DatePicker1.SelectedDate,
        id_tipo_pesquisa: ComboBox1_2.Selected.id_tipo_pesquisa,
        id_fiscalizacao: Concatenate(ComboBox1_1.Selected.id_contrato_empreendimento, "-", ComboBox1_2.Selected.id_tipo_pesquisa, "-", DatePicker1.SelectedDate),
        latitude: Location.Latitude,
        longitude: Location.Longitude
    }
);

ForAll(
    colDadosParaPatch, 
    Patch(
        db_acomp_fiscalizacoes, 
        Defaults(db_acomp_fiscalizacoes), 
        {
            id_contrato: ThisRecord.id_contrato,
            id_empreendimento: ThisRecord.id_empreendimento,
            id_tipo_pesquisa: ThisRecord.id_tipo_pesquisa,
            id_pergunta_pesquisa: ThisRecord.id_pergunta_pesquisa,
            data_fiscalizacao: ThisRecord.data_fiscalizacao,
            id_fiscalizacao: ThisRecord.id_fiscalizacao
        }
    )
);

Set(var_Nova_Fiscalizacao, Concatenate(ComboBox1_1.Selected.id_contrato_empreendimento, "-", ComboBox1_2.Selected.id_tipo_pesquisa, "-", DatePicker1.SelectedDate));
